#include <algorithm>
#include <cmath>
#include <cstdio>
#include <cstdlib>
#include <cstring>
using namespace std;

#define FR(i,a,b) for(int i=(a);i<(b);++i)
#define FOR(i,n) FR(i,0,n)
#define CLR(x,a) memset(x,a,sizeof(x))
#define setmax(a,b) a = max(a,b)
#define setmin(a,b) a = min(a,b)
typedef long long ll;

const int R=15,C=15;
int i;
char grid[16][16];
int colset[16];
void doit() {
  FOR(r,R) {
    scanf("%s",grid[r]);
    if (0==strcmp("END",grid[r])) exit(0);
  }

  int ans = 15;
  FOR(S,(1<<R)) {
    CLR(colset,0);

    FOR(r,R) if (0==((1<<r)&S)) {
      FOR(c,C) if (grid[r][c]=='#') colset[c]=1;
    }

    int now = 0;
    FOR(c,C) now += colset[c];
    setmax(now, __builtin_popcount(S));
    setmin(ans, now);
  }

  printf("%d\n",ans);
}
int main() {
  while (1) doit();
}

#include <algorithm>
#include <cmath>
#include <cstdio>
#include <cstdlib>
#include <cstring>
#include <deque>
#include <string>
#include <vector>
using namespace std;

#define SZ(v) int((v).size())
#define FR(i,a,b) for(int i=(a);i<(b);++i)
#define FOR(i,n) FR(i,0,n)
#define FORI(i,v) FOR(i,SZ(v))
#define CLR(x,a) memset(x,a,sizeof(x))
#define setmax(a,b) a = max(a,b)
#define setmin(a,b) a = min(a,b)
typedef long long ll;

int R,C;
char buf[16];
int deg[16][16];
int nod[16][16][4];
const int MAXV = 514;
bool mark[MAXV];
int cap[MAXV][MAXV];
vector<int> edg[MAXV];
const int s=MAXV-2,t=MAXV-1;
void connect(int v, int w, int u) {
  cap[v][w] = u;
  cap[w][v] = 0;
  edg[v].push_back(w);
  edg[w].push_back(v);
}
int dr[] = { -1, 0, 1, 0 },
    dc[] = { 0, 1, 0, -1 };
const int inf = 123456789;
int dfs(int v, int flocap=inf) {
  if (v==t) return flocap;

  if (mark[v]) return 0;
  mark[v] = 1;

  FORI(i,edg[v]) {
    int w = edg[v][i];
    if (cap[v][w]) {
      int f = dfs(w, min(flocap, cap[v][w]));

      if (f) {
	cap[v][w] -= f;
	cap[w][v] += f;
	return f;
      }
    }
  }
  return 0;
}
void doit() {
  scanf("%d%d",&R,&C);
  if (R==0) exit(0);

  FOR(v,MAXV) edg[v].clear();
  CLR(cap,0);

  FOR(r,R) {
    FOR(c,C) {
      scanf(" %s",buf);
      if (0==strcmp("x",buf)) deg[r][c]=0;
      else deg[r][c] = strlen(buf);
    }
  }

  int next = 0;
  FOR(r,R) FOR(c,C) {
    if (deg[r][c] != 2) {
      FOR(k,4) nod[r][c][k] = next;
      if ((r+c)%2) connect(s, next, deg[r][c]);
      else connect(next, t, deg[r][c]);
      ++next;
    } else {
      FOR(k,4) nod[r][c][k] = next + (k%2);
      if ((r+c)%2) FOR(k,2) connect(s, next+k, 1);
      else FOR(k,2) connect(next+k, t, 1);
      next += 2;
    }
  }

  FOR(r,R) FOR(c,C) if ((r+c)%2) {
    FOR(k,4) {
      int r2 = r+dr[k], c2 = c+dc[k];
      if (r2<0||r2>=R||c2<0||c2>=C) continue;
      int k2 = (k+2)%4;

      connect(nod[r][c][k], nod[r2][c2][k2], 1);
    }
  }

  while (1) {
    CLR(mark,0);
    int f = dfs(s);
    if (f == 0) break;
  }

  int ed=0,od=0;
  FOR(r,R) FOR(c,C) {
    if ((r+c)%2) od += deg[r][c];
    else ed += deg[r][c];
  }

  bool happy = 1;
  FOR(v,MAXV) if (cap[s][v] || cap[v][t]) happy = 0;

  printf("%s\n", happy ? "SOLVABLE" : "UNSOLVABLE");
}
int main() {
  while (1) doit();
}

#include<stdio.h>
#include<string.h>
#include<stdlib.h>
int main()
{
	int i,t;
	double x;
	char a[9];
	while(gets(a),strcmp(a,"END"))
	{
		x=atof(a);
		t=0;
		if(x==0||x==1)
			printf("MEMBER\n");
		else
		{
			i=13;
			while(i--)
			{
				x=(x-(int)x)*3;
				if((int)x==1)
				{
					printf("NON-MEMBER\n");
					t++;
					break;
				}
			}
			if(t==0)
				printf("MEMBER\n");
		}
	}
	return 0;
}

#include <algorithm>
#include <cmath>
#include <cstdio>
#include <cstdlib>
#include <cstring>
#include <deque>
#include <string>
#include <vector>
using namespace std;

#define SZ(v) int((v).size())
#define FR(i,a,b) for(int i=(a);i<(b);++i)
#define FOR(i,n) FR(i,0,n)
#define FORI(i,v) FOR(i,SZ(v))
#define CLR(x,a) memset(x,a,sizeof(x))
#define setmax(a,b) a = max(a,b)
#define setmin(a,b) a = min(a,b)
typedef long long ll;

int N,x,y,v,c;
int xs[30],ys[30];
double sqr(double x) { return x*x; }
double f(int i, int j, double a) {
  double x0 = xs[i]*(1-a) + xs[j]*a;
  double y0 = ys[i]*(1-a) + ys[j]*a;

  return sqrt(sqr(x-x0)+sqr(y-y0))/c + y0/v;
}
void doit() {
  scanf("%d%d%d%d%d",&N,&x,&y,&v,&c);
  if (N==0) exit(0);

  FOR(i,N) {
    scanf("%d%d",&xs[i],&ys[i]);
  }

  double t = 1e100;
  FOR(i,N) {
    int j = (i+1)%N;
    double lo = 0, hi = 1;

    FOR(k,200) {
      double m1 = (2*lo+hi)/3, m2 = (lo+2*hi)/3;
      
      if (f(i,j,m1) < f(i,j,m2)) hi = m2;
      else lo = m1;
    }

    setmin(t, f(i,j,lo));
  }

  printf("%.4lf\n",t);
}
int main() {
  while (1) doit();
}

#include<stdio.h>
#include<math.h>
int main()
{
	int n,a[1000001];
	double i,x,y,z;
	a[0]=1;
	for(i=1;i<=1000000;i++)
	{
		x=i-sqrt(i);
		y=log(i);
		z=i*sin(i)*sin(i);
		a[(int)i]=(a[(int)x]+a[(int)y]+a[(int)z])%1000000;
	}
	while(scanf("%d",&n)!=EOF,n!=-1)
		printf("%d\n",a[n]);
	return 0;
}
